	module.exports = {"title":"Using vmin and vmax in ie","date":"2015-9-9","category":"Javascript","layout":"blog","body":"<p>As you probably know if you like using CSS viewport units, the support for them isn’t fantastic.</p>\n<ul>\n<li><code>vmax</code> Isn’t supported in any version of ie or edge.</li>\n<li><code>vmin</code> Isn’t supported in ie9</li>\n</ul>\n<br>\n<h2>The CSS Viewport Units</h2>\n<ul>\n<li><code>vw</code>: 1/100th viewport width</li>\n<li><code>vh</code>: 1/100th viewport height</li>\n<li><code>vmin</code>: 1/100th of the smallest side</li>\n<li><code>vmax</code>: 1/100th of the largest side</li>\n</ul>\n<p>Note: IE9 uses <code>vm</code> instead of <code>vmin</code>. It does not support <code>vmax</code>.</p>\n<br>\n<h2>The CSS Viewport Units in Javascript</h2>\n<ul>\n<li><code>var vw = window.innerWidth / 100</code></li>\n<li><code>var vh = window.innerHeight / 100</code></li>\n<li><code>var vmin = Math.min(vw, vh)</code></li>\n<li><code>var vmax = Math.max(vw, vh)</code></li>\n</ul>\n<br>\n<h3>Setting your <code>html</code> font-size to a viewport unit and using em values everywhere, results in ridiculously responsive web pages</h3>\n<br>\nin *CSS:*\n<pre><code class=\"language-css\"><span class=\"hljs-comment\">/* Can't set the rem value to a viewpoint unit */</span>\n\n<span class=\"hljs-selector-class\">.mySelector</span> { \n  <span class=\"hljs-attribute\">font-size</span>: <span class=\"hljs-built_in\">calc</span>( 2vmin + 1.4vmax + 2vh ); \n}\n</code></pre>\n<br>\n<p>The same thing in javascript.</p>\n<pre><code class=\"language-js\"><span class=\"hljs-comment\">// but with javascript you can!</span>\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">setSize</span>(<span class=\"hljs-params\"></span>) </span>{\n  <span class=\"hljs-keyword\">var</span> vw   = <span class=\"hljs-built_in\">window</span>.innerWidth / <span class=\"hljs-number\">100</span>\n  <span class=\"hljs-keyword\">var</span> vh   = <span class=\"hljs-built_in\">window</span>.innerHeight / <span class=\"hljs-number\">100</span>\n  <span class=\"hljs-keyword\">var</span> vmin = <span class=\"hljs-built_in\">Math</span>.min(vw, vh)\n  <span class=\"hljs-keyword\">var</span> vmax = <span class=\"hljs-built_in\">Math</span>.max(vw, vh)\n  <span class=\"hljs-built_in\">document</span>.documentElement.style.fontSize =  (( vmin * <span class=\"hljs-number\">2</span> ) + ( vmax * <span class=\"hljs-number\">1.4</span> ) + ( vh * <span class=\"hljs-number\">2</span> ))  + <span class=\"hljs-string\">\"px\"</span>;\n}\n\n<span class=\"hljs-built_in\">window</span>.addEventListener(<span class=\"hljs-string\">\"resize\"</span>, setSize);\n<span class=\"hljs-built_in\">document</span>.addEventListener(<span class=\"hljs-string\">\"DOMContentLoaded\"</span>, setSize);\n</code></pre>\n"}

