	module.exports = {"title":"Hamburgler - Deliciously simple mobile navigation 🍔","layout":"blog","body":"<p>Deliciously simple mobile navigation in 4 easy steps. <br>\nNo longer relient on jQuery 🙌.</p>\n<p><a href=\"http://codepen.io/Johnm__/pen/OMqMmN\">View codepen demo</a></p>\n<br>\n<br>\n<ol>\n<li>Just give this code the ol’ copy-paste-a-roo just after your opening <code>&lt;body&gt;</code> tag.</li>\n</ol>\n<pre><code class=\"language-html\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"hamburgler-menu\"</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ul</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"hamburgler-menu-list\"</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">li</span>&gt;</span>never<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">li</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">li</span>&gt;</span>gonna<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">li</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">li</span>&gt;</span>give<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">li</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">li</span>&gt;</span>you<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">li</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">li</span>&gt;</span>up<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">li</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ul</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"hamburgler\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"hamburgler-icon-wrapper\"</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">span</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"hamburgler-icon\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">span</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n</code></pre>\n<br>\n<ol start=\"2\">\n<li>Paste this script just before your closing <code>&lt;/body&gt;</code> tag.</li>\n</ol>\n<pre><code class=\"language-html\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span>&gt;</span><span class=\"javascript\">\n  <span class=\"hljs-built_in\">document</span>.getElementById(<span class=\"hljs-string\">'hamburgler'</span>).addEventListener(<span class=\"hljs-string\">'click'</span>, checkNav);\n  <span class=\"hljs-built_in\">window</span>.addEventListener(<span class=\"hljs-string\">\"keyup\"</span>, <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\">e</span>) </span>{\n    <span class=\"hljs-keyword\">if</span> (e.keyCode == <span class=\"hljs-number\">27</span>) closeNav();\n  }, <span class=\"hljs-literal\">false</span>);\n\n  <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">checkNav</span>(<span class=\"hljs-params\"></span>) </span>{\n    <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-built_in\">document</span>.body.classList.contains(<span class=\"hljs-string\">'hamburgler-active'</span>)) {\n      closeNav();\n    } <span class=\"hljs-keyword\">else</span> {\n      openNav();\n    }\n  }\n\n  <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">closeNav</span>(<span class=\"hljs-params\"></span>) </span>{\n    <span class=\"hljs-built_in\">document</span>.body.classList.remove(<span class=\"hljs-string\">'hamburgler-active'</span>);\n  }\n\n  <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">openNav</span>(<span class=\"hljs-params\"></span>) </span>{\n    <span class=\"hljs-built_in\">document</span>.body.classList.add(<span class=\"hljs-string\">'hamburgler-active'</span>);\n  }\n</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n</code></pre>\n<br>\n<ol start=\"3\">\n<li>Paste inside the <code>&lt;head&gt; &lt;/head&gt;</code> of your html. <br> (or inlcude it in your stylesheets)</li>\n</ol>\n<pre><code class=\"language-css\"><span class=\"hljs-selector-class\">.hamburgler-icon-wrapper</span> {\n  <span class=\"hljs-attribute\">position</span>: absolute;\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">1em</span>;\n  <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">1em</span>;\n  <span class=\"hljs-attribute\">height</span>: <span class=\"hljs-number\">26px</span>;\n  <span class=\"hljs-attribute\">width</span>: <span class=\"hljs-number\">26px</span>;\n  <span class=\"hljs-attribute\">cursor</span>: pointer\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-icon</span>,\n<span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:before</span>,\n<span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:after</span> {\n  <span class=\"hljs-attribute\">content</span>: <span class=\"hljs-string\">''</span>;\n  <span class=\"hljs-attribute\">position</span>: absolute;\n  <span class=\"hljs-attribute\">border-radius</span>: <span class=\"hljs-number\">1em</span>;\n  <span class=\"hljs-attribute\">height</span>: <span class=\"hljs-number\">2px</span>;\n  <span class=\"hljs-attribute\">width</span>: <span class=\"hljs-number\">26px</span>;\n  <span class=\"hljs-attribute\">background</span>: black;\n  <span class=\"hljs-attribute\">transition</span>: all <span class=\"hljs-number\">0.2s</span> ease\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-icon</span> {\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0.75em</span>\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:before</span> {\n  <span class=\"hljs-attribute\">top</span>: -<span class=\"hljs-number\">0.55em</span>\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:after</span> {\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0.55em</span>\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span> {\n  <span class=\"hljs-attribute\">background</span>: transparent;\n  <span class=\"hljs-attribute\">transform</span>: <span class=\"hljs-built_in\">rotate</span>(-135deg)\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:before</span>,\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:after</span> {\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0</span>\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:before</span> {\n  <span class=\"hljs-attribute\">transform</span>: <span class=\"hljs-built_in\">rotate</span>(90deg)\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span>,\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:before</span>,\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-icon</span><span class=\"hljs-selector-pseudo\">:after</span> {\n  <span class=\"hljs-attribute\">background</span>: white\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-menu</span> {\n  <span class=\"hljs-attribute\">transition</span>: all <span class=\"hljs-number\">0.4s</span> ease;\n  <span class=\"hljs-attribute\">opacity</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">pointer-events</span>: none;\n  <span class=\"hljs-attribute\">position</span>: absolute;\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">right</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">bottom</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">background-color</span>: <span class=\"hljs-built_in\">rgba</span>(0, 0, 0, 0.9);\n  <span class=\"hljs-attribute\">color</span>: white;\n  <span class=\"hljs-attribute\">text-align</span>: center\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-menu</span> {\n  <span class=\"hljs-attribute\">opacity</span>: <span class=\"hljs-number\">1</span>;\n  <span class=\"hljs-attribute\">pointer-events</span>: initial;\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-menu-list</span> {\n  <span class=\"hljs-attribute\">display</span>: block;\n  <span class=\"hljs-attribute\">transition</span>: all <span class=\"hljs-number\">0.4s</span> ease;\n  <span class=\"hljs-attribute\">padding</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">list-style-type</span>: none;\n  <span class=\"hljs-attribute\">position</span>: absolute;\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">50%</span>;\n  <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">50%</span>;\n  <span class=\"hljs-attribute\">transform</span>: <span class=\"hljs-built_in\">translate</span>(-50%, -50%) <span class=\"hljs-built_in\">scale</span>(1.2)\n}\n\n<span class=\"hljs-selector-class\">.hamburgler-active</span> <span class=\"hljs-selector-class\">.hamburgler-menu-list</span> {\n  <span class=\"hljs-attribute\">transform</span>: <span class=\"hljs-built_in\">translate</span>(-50%, -50%) <span class=\"hljs-built_in\">scale</span>(1)\n}\n</code></pre>\n<ol start=\"4\">\n<li>booyah.</li>\n</ol>\n<br> \n<h3>Fastclick?</h3>\n<p>Hamburgler works even better when you have <a href=\"https://github.com/ftlabs/fastclick\">fastclick</a> on your website, It disables the .3s delay clicking links on a mobile device making everything seem snappier.</p>\n"}

